import React from 'react'

import "../styles/landing-page.scss";

import logo from "../assets/logo.png"

const Landingpage = () => {
    return (
        <>
            <div className="landing-container">

                <div className="landing-log">  <img src={logo} alt="" />
                <p></p></div>

            </div>
        </>
    )
}

export default Landingpage
